import React, { useState, useEffect } from 'react';
import { ArrowLeft } from 'lucide-react';

const ResultsPage = () => {
  const [data, setData] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [debugInfo, setDebugInfo] = useState(null);

  useEffect(() => {
    const fetchData = async () => {
      setDebugInfo(null);
      try {
        // Using a public test API
        const testApiUrl = 'https://jsonplaceholder.typicode.com/todos/1';
        setDebugInfo(prev => ({ ...prev, testApiUrl }));

        const response = await fetch(testApiUrl);
        if (!response.ok) {
          throw new Error(`HTTP error! status: ${response.status}`);
        }
        const jsonData = await response.json();

        setDebugInfo(prev => ({ ...prev, testApiResponse: jsonData }));
        setData(jsonData);
      } catch (err) {
        setError(err.message || 'An error occurred while fetching data.');
        console.error('API Error:', err);
        setDebugInfo(prev => ({ ...prev, errorDetails: err.toString() }));
      } finally {
        setLoading(false);
      }
    };

    fetchData();
  }, []);

  const handleBackClick = () => {
    window.history.back();
  };

  return (
    <div className="min-h-screen bg-gray-100 p-8">
      <div className="max-w-2xl mx-auto">
        <button 
          onClick={handleBackClick}
          className="flex items-center text-blue-600 hover:text-blue-800 mb-6"
        >
          <ArrowLeft className="mr-2" size={20} />
          Back to Search
        </button>

        {loading && (
          <div className="text-center text-gray-600">
            Loading data...
          </div>
        )}

        {error && (
          <div className="text-center text-red-500 mb-4">
            Error: {error}
          </div>
        )}

        {data && !loading && !error && (
          <div className="bg-white rounded-lg shadow-md p-6">
            <h1 className="text-2xl font-bold mb-4">Test Data</h1>
            <pre className="whitespace-pre-wrap">{JSON.stringify(data, null, 2)}</pre>
          </div>
        )}

        <div className="mt-8 bg-gray-200 p-4 rounded">
          <h2 className="text-lg font-semibold mb-2">Debug Information</h2>
          <pre className="whitespace-pre-wrap">{JSON.stringify(debugInfo, null, 2)}</pre>
        </div>
      </div>
    </div>
  );
};

export default ResultsPage;
